script: |
  super -f text -I q13689.spq | sort > q13689.out

inputs:
  - name: q13689.spq
    data: |
      SELECT ALL - 83 AS col1 FROM tab1 (FORMAT parquet) WHERE - col2 IN ( + + CAST ( col2 AS INTEGER ), + ( + + 24 ) - + col0 * + 90, + - col2 );
  - name: tab1

outputs:
  - name: q13689.out
    data: |
      -83
      -83
      -83
